--
-- Triggers `payment_vs_po_or_services`
--
DELIMITER $$
CREATE TRIGGER `updatePurchasePaymentStatusInsert` AFTER INSERT ON `payment_vs_po_or_services` FOR EACH ROW BEGIN
    UPDATE purchase
    SET paid_amount = (
            SELECT SUM(sent_amount)
            FROM payment_vs_po_or_services
            WHERE payment_vs_po_or_services.expense_id = NEW.expense_id AND payment_vs_po_or_services.deleted = '0'
        )
    WHERE purchase.id = NEW.expense_id;

    UPDATE purchase
    SET payment_status = 
        CASE
            WHEN general_total_price = paid_amount THEN 'paid'
            WHEN (paid_amount < general_total_price AND paid_amount > 0) THEN 'partially_paid'
            ELSE 'unpaid'
        END
    WHERE purchase.id = NEW.expense_id;
END
$$
