--
-- Triggers `transaction`
--
DELIMITER $$
CREATE TRIGGER `transactionUpdateAccountInsert` AFTER INSERT ON `transaction` FOR EACH ROW BEGIN
       IF NEW.deleted = '0' THEN

              IF NEW.action = 'in' THEN 

                     UPDATE accounts
                            SET balance = balance + NEW.amount 
                            WHERE accounts.id = NEW.account;
                     
              END IF;   


              IF NEW.action = 'out' THEN 

                     UPDATE accounts
                            SET balance = balance - NEW.amount 
                            WHERE accounts.id = NEW.account;
                     
              END IF;    
        
        END IF;
     
END
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `transactionUpdateAccountUpdate` AFTER UPDATE ON `transaction` FOR EACH ROW BEGIN
       IF NEW.deleted = '1' AND   OLD.deleted = '0' THEN

              IF NEW.action = 'in' THEN 

                     UPDATE accounts
                            SET balance = balance - NEW.amount 
                            WHERE accounts.id = NEW.account;
                     
              END IF;   


              IF NEW.action = 'out' THEN 

                     UPDATE accounts
                            SET balance = balance + NEW.amount 
                            WHERE accounts.id = NEW.account;
                     
              END IF;    
        
        END IF;
     
END
$$
DELIMITER ;

